import React from 'react';
import PropTypes from 'prop-types';
import { withStyles } from '@material-ui/core/styles';
import Card from '@material-ui/core/Card';
import CardContent from '@material-ui/core/CardContent';
import Typography from '@material-ui/core/Typography';
import AutoComplete from './AutoComplete.js';

const styles = theme => ({
  card: {
    display: '',
    width: 650,
    margin:25,
    height: 800,
  },
  details: {
    display: 'flex',
    flexDirection: '',
  },
  content: {
    flex: '',
  },
  cover: {
    width: 10,
  },
  controls: {
    display: 'flex',
    alignItems: 'center',
    paddingLeft: theme.spacing.unit,
    paddingBottom: theme.spacing.unit,
  },
});

class CardCase6 extends React.Component {
  constructor(props){
    super(props)
    this.state = {
      value : null,
      m1: this.props.foo
    }
  }

  onSubmit = (value) => {
    this.setState({value})
  }

  onSubmitUrl = (value2) => {
    this.setState({value2})
  }



  render(){
  const x = []
  const { classes, theme, foo1} = this.props;
  for( var key in foo1)
  {
    x.push(foo1[key].title)
  }
  this.setState({x})
  return (
    <Card className={classes.card}>
      <div className={classes.details}>
        <CardContent className={classes.content}>

        <Typography component="h15" variant="h15">
            <div className="container_4">
              <p>Results</p>
              <div id="scroll">{this.state.value}</div>
              <p>Url:</p>
              <div className="c4"><a href={this.state.value2}>{this.state.value2}</a></div>
            </div>
        </Typography>
        </CardContent>
      </div>
    </Card>
  );
  }
}

CardCase6.propTypes = {
  classes: PropTypes.object.isRequired,
  theme: PropTypes.object.isRequired,
};

export default withStyles(styles, { withTheme: true })(CardCase6);
